description:
After his battles with the communist mayor Peppone, Don Camillo is sent in exile by his bishop in a remote village. Peppone thought he got the village in his hands. But when the municipality decide to build a dike against the periodic floods, the proprietor of the land refuses. War between the village clans is about to begin. Maybe only the strong hand of the priest could persuade the landlord to change his mind (1953)

Director: Julien Duvivier

Stars: Fernandel, Gino Cervi

